const [errors,setErrors] = useState(null);
const [antique,setAntique] = useState(null);
const {id} = useParams();

useEffect(()=>{
    async function loadAntique(){
        let ac= new AbortController();
        try{
            setAntique(await findAntique(id))
        } catch(err){setErrors(err)}
        return ()=> ac.abort();
    }
    loadAntique();
},[id])


const loadedAntiqueFields = {
    category:antique.category,
    quantity:antique.quantity,
    name:antique.name,
    value:antique.value,
    material:antique.material,
    color:antique.color,
    style:antique.style,
    brand:antique.brand,
    model:antique.model,
    timePeriod:antique.timePeriod,
    condition:antique.condition,
    origin:antique.origin,
    purpose:antique.purpose,
    owner:antique.owner,
    history:antique.history,
    size:antique.size,
    comment:antique.comment,
 }


    return (<div>Edit Antique

    
    <div className="form-container">
    <h3 className="title-container">Create New Antique</h3>
    <form onSubmit={(e)=>{
        e.preventDefault();
        console.log('submit Clicked',form)
        submitHandler(form);
